// src/icons.js
import { library } from '@fortawesome/fontawesome-svg-core';
import { faPhone, faEnvelope, faUser, faUpload, faIdCard, faCalendar,faArrowUp, faArrowDown, faArrowLeft, faArrowRight} from '@fortawesome/free-solid-svg-icons';

library.add(faPhone, faEnvelope, faUser, faUpload, faIdCard,faCalendar,faArrowUp, faArrowDown, faArrowLeft, faArrowRight);
